import React, { Component } from "react";

const Project = props => {
  console.log(props);
  return props.projects.map(p => (
    <React.Fragment>
      <h1>Project {p.uid}</h1>
      <h3>Name: {p.shortname}</h3>
    </React.Fragment>
  ));
};

export default Project;
